INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (11, 10, 0.5, 23814, 0, 1, "今日は何の日か、もちろん分かるよね？\nこの世で一番かわいくて美しいボクが\n誕生して、みんなの美意識が刷新された\nことをお祝いする、世界的記念日だよ♪", 23814070, 0, 100811, 1);
