INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (11, 10, 0.5, 38214, 0, 1, "マヒルさん、どうしました……？\nもしかして、誕生日ケーキに\n変なところでも……？", 38214070, 0, 103811, 1);
